/**
 * Look up a bus stop by its stop code
 */
export function lookupBusStop(stopCode) {
  const stop = CTA_BUS_STOPS[stopCode];
  if (!stop) return null;
  
  return {
    id: stopCode,
    name: stop.n,
    lat: parseFloat(stop.lat),
    lon: parseFloat(stop.lon)
  };
}
